import React from "react";
import Profile from "../layout/home/Profile";
import InfoRow from "../componants/InfoRows/InfoRow";

function Home() {
  return (
    <>
      <Profile
        f1="Hello,"
        name="WE ARE YUG AND DEEP..."
        std="Web Developer"
        from="From Surat"
      />
      <InfoRow />
    </>
  );
}

export default Home;
